import React, {useState} from "react";
import axios from "axios";

 export default function UserLogout () {

    const [status,setStatuse] = useState('false');
    const [resp,setResp] = useState(null);
    let doLout = ()=> {
        let url = '/logout';
        let data = {
            status: status,
        }
        axios.post(url, data).then((res) => {
            setStatuse('true');
            setResp("Success: city added.");

        }).catch((err) => {
            setResp("Error: failed to add city.");
        })
    }
    return (
        <div>
        <button onClick={doLout}>Logout</button>
            <div>
                {resp?resp:null}
            </div>
        </div>)
     }
